import './App.css';
import React from 'react';
import { Button, Icon } from '@material-ui/core';

// Button Component
function SendBtn() {
    return (
        <div className="sendBtn">
            <Button
                variant="contained"
                color="primary"
                endIcon={<Icon>send</Icon>}
                onClick={onChange}
                value
            >
                Send
      </Button>
        </div>
    );
}

export default SendBtn;
